def maxCoins(self, nums: List[int]) -> int:
    nums = [1] + nums + [1]
    n = len(nums)
    dp = [[0] * n for _ in range(n)]
    for k in range(2, n):
        for i in range(n - k):
            j = i + k
            for x in range(i + 1, j):
                dp[i][j] = max(dp[i][j], nums[i] * nums[x] * nums[j] + dp[i][x] + dp[x][j])
    return dp[0][-1]
